DROP TABLE IF EXISTS School;
CREATE TABLE School
(
  Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  Rank_Overall INT,
  Name VARCHAR(100) NOT NULL,
  Size INT,
  In_State_Tuition_Fee INT DEFAULT NULL,
  Tuition_Fee INT,
  Room_Board INT,
  Average_Freshman_Retention_Rate INT,
  Six_Year_Graduation_Rate INT,
  Toefl INT,
  ielts INT,
  SAT1_Percentile_25 INT,
  SAT1_Percentile_75 INT,
  SAT2_Required INT,
  ACT_Percentile_25 INT,
  ACT_Percentile_75 INT,
  SAT_ACT_Not_Required VARCHAR(5) DEFAULT NULL,
  Accept_Rate FLOAT,
  Reputation_Score FLOAT,
  Selectivity VARCHAR(15),
  HS_Class_Top_10_Percentage FLOAT,
  Student_Faculty_Ratio FLOAT,
  Percentage_Classes_Fewer_Than_20_students FLOAT,
  Percentage_Classes_More_Than_50_students FLOAT,
  Application_Deadline VARCHAR(10),
  Application_Fee INT,
  SAT_ACT_Received_Deadline VARCHAR(10),
  Early_Decision_Deadline VARCHAR(10),
  Category VARCHAR(40),
  Intl_Financial_Aid VARCHAR(25),
  Type VARCHAR(20),
  City VARCHAR(80),
  State VARCHAR(2),
  Setting VARCHAR(15),
  Calendar VARCHAR(10),
  Phone VARCHAR(20),
  Website VARCHAR(100),
  INDEX NameIndex(Name)
);

